import { useAuth } from "../lib/auth2";
import React, { useState } from "react";
import { Form, FormGroup, Label, Input } from "reactstrap";

export default function Profile() {
  const { user } = useAuth();

  return;
  <Form>
    <FormGroup switch>
      <Input
        type='switch'
        role='switch'
      />
      <Label check>Default switch checkbox input</Label>
    </FormGroup>
  </Form>;
}

